import React from 'react' ;



function Navbar(props) {
  return(


  <div>
   <nav>
    <div className="nav-wrapper">
  <a href="#!" className="brand-logo">{ props.brandname}</a>
      <a href="#" data-target="mobile-demo" className="sidenav-trigger"><i className="material-icons">menu</i></a>
      <ul className="right hide-on-med-and-down">
        
        
       {/* <li> <Link to='/'>Home</Link>      </li>
       <li> <Link to='/about'>About</Link> </li>
       <li> <Link to='/contact'>Contact</Link> </li> */}


<li><a href="/">Home</a></li>
    <li><a href="about">About</a></li>
    <li><a href="collapsible.html">Service</a></li>
    <li><a href="contact">Contact</a></li>
      
      </ul>
    </div>
  </nav>

  <ul className="sidenav" id="mobile-demo">
    <li><a href="sass.html">Home</a></li>
    <li><a href="badges.html">About</a></li>
    <li><a href="collapsible.html">Service</a></li>
    <li><a href="mobile.html">Contact</a></li>
  </ul>
          

  </div>
  );
}


export function CustomFooter(props){
  return(

    <div className="row footer"> 
      
      <div className="col s6 footer-text right-align"> 
        All rights reserved by : 
      </div>
      
      <div className="col s6 footer-link left-align"> 
        <a href="hello"> ReactTut.com </a>
      </div>
  
    </div>

  );
}

export default Navbar ;
